#! /usr/bin/python#! coding=UTF-8import sysimport unittestfrom selenium import webdriverfrom f_LoginPage import LoginPageclass CaseLogin126main(unittest.TestCase):    '''    login case    '''    @classmethod    def setUp(cls):        cls.driver = webdriver.Chrome()        cls.driver.implicitly_wait(30)        cls.url = "http://"        cls.username = "xxx"        cls.password = "xxx"        #用例执行体    def test_login_mail(self):        #声明LoginPage类对象        login_page = LoginPage(self.driver,self.url,u"xxx")        # 调用打卡页面组件        login_page.open()        #调用用户名输入组件        login_page.input_username(self.username)        # 调用密码输入组件        login_page.input_password(self.password)        # 调用登录按钮组件        login_page.click_submit()        @classmethod        def tearDownClass(cls):            cls.driver.quit()if __name__=="__main__":    unittest.main()